DROP TABLE IF EXISTS  `pre_min_booth_product`;
CREATE TABLE `pre_min_booth_product` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `booth_id` int(11) unsigned NOT NULL COMMENT '展位ID',
  `product_id` int(11) unsigned NOT NULL COMMENT '产品ID',
  PRIMARY KEY (`id`),
  KEY `BOOTH` (`booth_id`)
