DROP TABLE IF EXISTS  `pre_min_booth_v2`;
CREATE TABLE `pre_min_booth_v2` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `company` varchar(50) NOT NULL COMMENT '企业',
  `introduce` tinytext COMMENT '产品介绍',
  `exhibition_hotel_id` int(11) NOT NULL COMMENT '场所',
  `floor` varchar(10) NOT NULL COMMENT '几层楼或者几号馆',
  `exhibition_code` varchar(20) NOT NULL COMMENT '展位号',
  `address` varchar(100) NOT NULL COMMENT '地址',
  `contact` varchar(25) NOT NULL COMMENT '联系人',
  `tel` varchar(25) NOT NULL COMMENT '电话',
  `start_time` varchar(30) DEFAULT NULL COMMENT '开始时间',
  `end_time` varchar(30) DEFAULT NULL COMMENT '结束时间',
  `img` tinytext NOT NULL COMMENT '图片URL',
  `primary_label` tinytext CHARACTER SET utf8mb4 NOT NULL COMMENT '一级标签',
  `two_label` tinytext CHARACTER SET utf8mb4 NOT NULL COMMENT '二级标签',
  `three_label` tinytext CHARACTER SET utf8mb4 NOT NULL COMMENT '三级标签',
  `is_hot` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否热门，1为热门',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `products` tinytext COMMENT '产品',
  PRIMARY KEY (`id`),
  KEY `EHFLOOR` (`exhibition_hotel_id`,`floor`)
) ENGINE=InnoDB AUTO_INCREMENT=134 DEFAULT CHARSET=utf8 COMMENT='展位表';

