DROP TABLE IF EXISTS  `pre_min_exhibition_hotel`;
CREATE TABLE `pre_min_exhibition_hotel` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `bgimg_id` int(11) NOT NULL COMMENT '背景图id',
  `type` tinyint(1) NOT NULL COMMENT '种类：1酒店，2展馆',
  `recommend` tinyint(1) NOT NULL DEFAULT '0' COMMENT '推荐:0否 1是',
  `name` varchar(50) NOT NULL COMMENT '酒店或者展馆名称',
  `tel` varchar(50) DEFAULT NULL COMMENT '电话号码',
  `introduce` varchar(600) NOT NULL COMMENT '介绍',
  `primary_label` varchar(40) DEFAULT NULL COMMENT '一级标签',
  `two_label` varchar(40) DEFAULT '' COMMENT '二级标签',
  `three_label` varchar(40) DEFAULT '' COMMENT '三级标签',
  `address` varchar(100) NOT NULL COMMENT '地址',
  `logo` varchar(150) NOT NULL COMMENT 'logo',
  `lat` varchar(30) NOT NULL DEFAULT '0' COMMENT '纬度，范围为-90~90，负数表示南纬',
  `lng` varchar(30) NOT NULL DEFAULT '0' COMMENT '经度，范围为-180~180，负数表示西经',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='酒店-展馆表';

DROP TABLE IF EXISTS  `pre_min_exhibition_hotel_v2`;
CREATE TABLE `pre_min_exhibition_hotel_v2` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `type` tinyint(1) NOT NULL COMMENT '种类：1酒店，2展馆',
  `recommend` tinyint(1) NOT NULL DEFAULT '0' COMMENT '推荐：0否 1是',
  `name` varchar(50) NOT NULL COMMENT '酒店或者展馆名称',
  `tel` varchar(50) CHARACTER SET utf8 DEFAULT NULL COMMENT '电话号码',
  `introduce` tinytext CHARACTER SET utf8 NOT NULL COMMENT '介绍',
  `floors` tinytext COMMENT '哪些层楼/展馆',
  `floors_alias` tinytext COMMENT '楼层别名',
  `primary_label` tinytext COMMENT '一级标签',
  `two_label` tinytext COMMENT '二级标签',
  `three_label` tinytext COMMENT '三级标签',
  `address` varchar(100) NOT NULL COMMENT '地址',
  `logo` tinytext NOT NULL COMMENT 'logo',
  `lat` decimal(10,7) DEFAULT '30.0000000' COMMENT '纬度，范围为-90~90，负数表示南纬',
  `lng` decimal(10,7) DEFAULT '30.0000000' COMMENT '经度，范围为-180~180，负数表示西经',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态',
  `banner` tinytext COMMENT '横幅',
  PRIMARY KEY (`id`),
  KEY `TYPE` (`type`)
) ENGINE=InnoDB AUTO_INCREMENT=19 DEFAULT CHARSET=utf8mb4 COMMENT='酒店-展馆表';

