) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='资讯图片表';

DROP TABLE IF EXISTS  `pre_min_news_v2`;
CREATE TABLE `pre_min_news_v2` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(150) NOT NULL DEFAULT '无标题资讯' COMMENT '资讯标题',
  `category` tinyint(2) NOT NULL DEFAULT '1' COMMENT '分类ID 1展会咨询，2展会指南 3首页推荐',
  `type` tinyint(1) DEFAULT '1' COMMENT '类型：1文字，2单图，3多图，4大图，5视频，6轮播图',
  `tab` varchar(50) DEFAULT NULL COMMENT '标签',
  `editor` varchar(50) DEFAULT NULL COMMENT '编辑者',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '上传时间',
  `content` text COMMENT '富文本内容',
  `is_top` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否置顶：1是 0 否',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态',
  `covers` tinytext COMMENT '封面：JSON格式',
  PRIMARY KEY (`id`),
  KEY `TYPEINDEX` (`category`,`type`),
  KEY `CATEGORY` (`category`)
) ENGINE=InnoDB AUTO_INCREMENT=95 DEFAULT CHARSET=utf8 COMMENT='资讯表v2版';

insert into `pre_min_news_v2`(`id`,`name`,`category`,`type`,`tab`,`editor`,`create_time`,`content`,`is_top`,`status`,`covers`) values
('66','轮播模式测试','1','6','轮播图','lan','2017-10-14 21:16:28','<p class="MsoNormal" style="line-height: 26.25pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(34,34,34);font-size:18.0000pt;mso-font-kerning:18.0000pt;">2017秋季全国糖酒会酒店交通全攻略！</span><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(34,34,34);font-size:18.0000pt;mso-font-kerning:18.0000pt;"><o:p></o:p></span></p><p class="p" style="margin-top: 0pt; margin-bottom: 0pt; text-indent: 24pt; line-height: 24.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;">2017秋季全国糖酒会即将开幕，面对被网友称为“3D魔幻城市”重庆，就算是智能地图也难以将重庆的大街小巷表达地清楚完整。</span><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><o:p></o:p></span></p><p class="p" style="margin-top: 0pt; margin-bottom: 0pt; text-indent: 24pt; line-height: 24.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><font face="微软雅黑">今天，小编就为大家整合了食品展区和酒类展区的两大热门酒店</font>----重庆两江酒店和长度假日酒店的交通攻略。</span><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><o:p></o:p></span></p><p class="p" style="margin-top: 0pt; margin-bottom: 0pt; text-indent: 24pt; line-height: 24.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><font face="微软雅黑">先给放一张地图，以便了解各大酒店的地理方位。</font></span><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><o:p></o:p></span></p><p class="p" align="center" style="margin-top: 0pt; margin-bottom: 0pt; text-align: center; line-height: 24.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><img src="http://pic.jiushang.cn/upload/web_app/11/2017/10/24/TkdfGX5BxQ.png" style="width: 100%;"><br></p><p class="p" style="margin-top: 0pt; margin-bottom: 0pt; text-indent: 24pt; line-height: 24.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><font face="微软雅黑">重庆两江酒店</font></span><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><o:p></o:p></span></p><p class="p" style="margin-top: 0pt; margin-bottom: 0pt; text-indent: 24pt; line-height: 24.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><font face="微软雅黑">两江酒店位于重庆秋糖的食品热点商圈</font>-红旗河沟的正中心，这里是重庆市双轨换乘中心，地理位置优越，交通十分便利。重庆市中心高端酒店群以两江酒店为龙头，北邻和府、渝通饭店，南有伊美、小天鹅、希尔顿酒店，商圈成熟。无论客商如何南来北往，两江酒店都是必经之处，是人气聚集的中心地带。</span><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><o:p></o:p></span></p><p class="p" style="margin-top: 0pt; margin-bottom: 0pt; text-indent: 24pt; line-height: 24.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;">2014年秋季食品专区在两江酒店成功设展，两江酒店火爆的招商人气得到了很多企业的认可，因此，两江酒店也一举成为2014年重庆秋季糖酒会设展人气旺、效果好的酒店。</span><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><o:p></o:p></span></p><p class="p" style="margin-top: 0pt; margin-bottom: 0pt; text-indent: 24pt; line-height: 24.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><font face="微软雅黑">轻轨路线</font></span><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><o:p></o:p></span></p><p class="p" style="margin-top: 0pt; margin-bottom: 0pt; text-indent: 24pt; line-height: 24.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><font face="微软雅黑">重庆市轻轨</font>3号线由北至南贯通全城，连接了重庆江北机场、重庆北站、红旗河沟、国际会展中心四大糖酒会交通热点。</span><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><o:p></o:p></span></p><p class="p" style="margin-top: 0pt; margin-bottom: 0pt; text-indent: 24pt; line-height: 24.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><font face="微软雅黑">如果各位前来参展的企业和专业人士乘坐高铁或者飞机到达重庆，均可步行至就近的轻轨站点，乘坐轻轨</font>3号线，至红旗河沟站1口出站，即可到达两江酒店。而由会展中心至两江酒店也可步行至工贸站，乘坐轻轨3号线。</span><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><o:p></o:p></span></p><p class="p" style="margin-top: 0pt; margin-bottom: 0pt; text-indent: 24pt; line-height: 24.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><font face="微软雅黑">公交路线</font></span><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><o:p></o:p></span></p><p class="p" style="margin-top: 0pt; margin-bottom: 0pt; text-indent: 24pt; line-height: 24.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><font face="微软雅黑">相关人士到达重庆北站后，公交</font>217、818、202、821路均可到达重庆两江酒店。</span><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><o:p></o:p></span></p><p class="p" style="margin-top: 0pt; margin-bottom: 0pt; text-indent: 24pt; line-height: 24.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><font face="微软雅黑">机场方面，公交可乘坐</font>K001路，下车后步行800米即可到达重庆两江酒店</span><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><o:p></o:p></span></p><p class="p" style="margin-top: 0pt; margin-bottom: 0pt; text-indent: 24pt; line-height: 24.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><font face="微软雅黑">有去往会展中心的人士，从重庆两江酒店出发，可乘坐</font>872、115、319、145路公交至会展中心。</span><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><o:p></o:p></span></p><p class="p" style="margin-top: 0pt; margin-bottom: 0pt; text-indent: 24pt; line-height: 24.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><font face="微软雅黑">重庆长都假日酒店</font></span><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><o:p></o:p></span></p><p class="p" style="margin-top: 0pt; margin-bottom: 0pt; text-indent: 24pt; line-height: 24.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><font face="微软雅黑">重庆长都假日酒店为洲际酒店集团旗下四星级高档酒店，洲际酒店集团是目前全球大及网络分布广的专业酒店管理集团，有超过</font>60年国际酒店管理经验，分布全世界近100个国家。长都假日酒店与火车站综合区域、市中心食品饮料区域相互呼应，填补酒类展会空白，造就糖酒会核心商圈，优势彰显，商机无限。</span><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><o:p></o:p></span></p><p class="p" style="margin-top: 0pt; margin-bottom: 0pt; text-indent: 24pt; line-height: 24.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><font face="微软雅黑">地铁路线</font></span><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><o:p></o:p></span></p><p class="p" style="margin-top: 0pt; margin-bottom: 0pt; text-indent: 24pt; line-height: 24.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><font face="微软雅黑">重庆北站、江北国际机场、会展中心到长都假日酒店，均可乘轻轨</font>3号线到红旗河沟站换乘6号线，在红土地站出站，即可到达长都假日酒店。</span><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><o:p></o:p></span></p><p class="p" style="margin-top: 0pt; margin-bottom: 0pt; text-indent: 24pt; line-height: 24.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><font face="微软雅黑">公交路线</font></span><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><o:p></o:p></span></p><p class="p" style="margin-top: 0pt; margin-bottom: 0pt; text-indent: 24pt; line-height: 24.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><font face="微软雅黑">由重庆北站至长都假日酒店，</font>841、202、617路均可到达目的地。</span><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><o:p></o:p></span></p><p class="p" style="margin-top: 0pt; margin-bottom: 0pt; text-indent: 24pt; line-height: 24.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><font face="微软雅黑">机场至长都假日酒店，较为便捷的路线为轻轨</font>3、6号线的换乘路线，如选择公交可乘坐3号线至红旗河沟站换乘550、354路公交到达目的地。</span><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><o:p></o:p></span></p><p class="p" style="margin-top: 0pt; margin-bottom: 0pt; text-indent: 24pt; line-height: 24.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><font face="微软雅黑">会展中心至长都假日酒店，若选择乘坐公交，</font>149、323路可到达。</span><span style="mso-spacerun:\'yes\';font-family:微软雅黑;mso-bidi-font-family:宋体;color:rgb(69,69,69);font-size:12.0000pt;mso-font-kerning:0.0000pt;"><o:p></o:p></span></p><p class="MsoNormal" style="word-break: break-all; background: rgb(228, 240, 253);"><br></p>','1','1','["http:\\/\\/pic.jiushang.cn\\/upload\\/web_app\\/11\\/2017\\/10\\/31\\/JBydRn4rSr.JPG"]'),
('69','这是单图模式','1','2','单图','lan','2017-10-15 19:46:05','<p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;重庆有“中国桥都”之称， 拥有大小桥梁1.3万多座，桥型众多，也被喻为“万桥之都”。桥，已经成为重庆一张靓丽的城市名片。首届重庆十大最美桥梁评选结果已经出炉了，该活动是由市桥梁协会、重庆晨报主办，先期推选出了20座候选桥梁，再由市民及桥梁专家进行投票筛选得出，快来看看这些桥梁，你去过几座？</p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-weight: 700; margin: 0px; padding: 0px; list-style: none;">石板坡长江大桥+石板坡大桥复线桥</span></p><p align="center" style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;"></p><p align="center" style="margin-bottom: 30px; font-family: 宋体; list-style: none; font-size: 12px; line-height: 20px; width: 650px; overflow: hidden; height: 20px; color: rgb(0, 51, 153);">点击图片查看下一页</p><img id="31406723" title="点击图片进入下一页" border="0" align="center" src="http://i3.cqnews.net/life/attachement/jpg/site82/20151125/b8aeed9d94bd17bfae2b37.jpg" sourcename="本地文件" sourcedescription="编辑提供的本地文件" alt="点击图片进入下一页" style="border-style: none; font-family: 宋体; font-size: 16px; margin: 0px; padding: 0px; list-style: none; cursor: pointer;"><p style="font-family: 宋体; font-size: 16px;"></p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;石板坡长江大桥桥头现有春、夏、秋、冬四座大型铝合金塑像。石板坡长江大桥复线桥主跨是目前世界同类型桥梁中跨径最大的。</p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-weight: 700; margin: 0px; padding: 0px; list-style: none;">万州长江公路大桥</span></p><p align="center" style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;"><img id="31406725" title="点击图片进入下一页" border="0" align="center" src="http://i4.cqnews.net/life/attachement/jpg/site82/20151125/b8aeed9d94bd17bfae3338.jpg" sourcename="本地文件" sourcedescription="编辑提供的本地文件" alt="点击图片进入下一页" style="border-style: none; margin: 0px; padding: 0px; list-style: none; cursor: pointer;"></p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;大桥全长856米，桥高147米(枯水位以上)，1997年5月竣工，是当时世界上跨径和规模最大的钢筋混凝土拱桥。</p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-weight: 700; margin: 0px; padding: 0px; list-style: none;">鹅公岩长江大桥</span></p><p align="center" style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;"><img id="31406729" title="点击图片进入下一页" border="0" align="center" src="http://i1.cqnews.net/life/attachement/jpg/site82/20151125/b8aeed9d94bd17bfae3d39.jpg" sourcename="本地文件" sourcedescription="编辑提供的本地文件" alt="点击图片进入下一页" style="border-style: none; margin: 0px; padding: 0px; list-style: none; cursor: pointer;"></p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;鹅公岩大桥连接九龙坡区和南岸区，双向六车道，高耸的门型双塔成为城市一大景观！大桥悬索还漆上了漂亮的朱红色，被市民誉为“主城最美大桥”！</p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-weight: 700; margin: 0px; padding: 0px; list-style: none;">菜园坝长江大桥</span></p><p align="center" style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;"><img id="31406731" title="点击图片进入下一页" border="0" align="center" src="http://i2.cqnews.net/life/attachement/jpg/site82/20151125/b8aeed9d94bd17bfae403a.jpg" sourcename="本地文件" sourcedescription="编辑提供的本地文件" alt="点击图片进入下一页" style="border-style: none; margin: 0px; padding: 0px; list-style: none; cursor: pointer;"></p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;菜园坝大桥位于两路口到南坪之间的江水之上，整座桥采用环保的防腐涂装，两道橘红色的“飞虹”异常醒目，是目前国内最大的公共交通和城市轻轨两用大跨径拱桥，也是世界第一座采用缆索吊机安装的大桥。</p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-weight: 700; margin: 0px; padding: 0px; list-style: none;">大宁河特大桥</span></p><p align="center" style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;"><img id="31406733" title="点击图片进入下一页" border="0" align="center" src="http://i3.cqnews.net/life/attachement/jpg/site82/20151125/b8aeed9d94bd17bfae443b.jpg" sourcename="本地文件" sourcedescription="编辑提供的本地文件" alt="点击图片进入下一页" style="border-style: none; margin: 0px; padding: 0px; list-style: none; cursor: pointer;"></p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;大桥全长682米，建设时主桥跨径规模居同类型拱桥世界第二、中国第一。荣获2011年重庆市科技进步二等奖。</p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-weight: 700; margin: 0px; padding: 0px; list-style: none;">朝天门长江大桥</span></p><p align="center" style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;"><img id="31406735" title="点击图片进入下一页" border="0" align="center" src="http://i4.cqnews.net/life/attachement/jpg/site82/20151125/b8aeed9d94bd17bfae483c.jpg" sourcename="本地文件" sourcedescription="编辑提供的本地文件" alt="点击图片进入下一页" style="border-style: none; margin: 0px; padding: 0px; list-style: none; cursor: pointer;"></p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;朝天门长江大桥位于重庆主城区，西连江北五里店，东接南岸弹子石，主跨为世界跨径最大的拱桥。这座桥不管是白天还是黑夜看起来都非常宏伟壮观。</p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-weight: 700; margin: 0px; padding: 0px; list-style: none;">江津观音岩长江大桥</span></p><p align="center" style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;"><img id="31406737" title="点击图片进入下一页" border="0" align="center" src="http://i1.cqnews.net/life/attachement/jpg/site82/20151125/b8aeed9d94bd17bfae4e3d.jpg" sourcename="本地文件" sourcedescription="编辑提供的本地文件" alt="点击图片进入下一页" style="border-style: none; margin: 0px; padding: 0px; list-style: none; cursor: pointer;"></p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;桥全长1198.94米，是高速公路上第一座跨长江的钢混组合梁斜拉桥，获2011年重庆市科技进步二等奖。</p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;<span style="font-weight: 700; margin: 0px; padding: 0px; list-style: none;">嘉悦嘉陵江大桥</span></p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;"><img id="31406740" title="点击图片浏览更多精彩内容" border="0" align="center" src="http://i4.cqnews.net/life/attachement/jpg/site82/20151125/b8aeed9d94bd17bfae5d3e.jpg" sourcename="本地文件" sourcedescription="编辑提供的本地文件" alt="点击图片浏览更多精彩内容" style="border-style: none; margin: 0px; padding: 0px; list-style: none; cursor: pointer;"></p><p style="font-family: 宋体; font-size: 16px;"></p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;大桥全长774米，2010年2月竣工，大桥分上下两层，为重庆首座埃塔斜拉桥，获第十一届中国土木工程詹天佑奖。</p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-weight: 700; margin: 0px; padding: 0px; list-style: none;">江津鼎山长江大桥</span></p><p align="center" style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;"><img id="31406744" title="点击图片浏览更多精彩内容" border="0" align="center" src="http://i1.cqnews.net/life/attachement/jpg/site82/20151125/b8aeed9d94bd17bfae623f.jpg" sourcename="本地文件" sourcedescription="编辑提供的本地文件" alt="点击图片浏览更多精彩内容" style="border-style: none; margin: 0px; padding: 0px; list-style: none; cursor: pointer;"></p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;大桥为双塔双索面公轨两用斜拉桥，塔柱高188.3米，是长江中上游第一座公轨两用斜拉桥。</p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-weight: 700; margin: 0px; padding: 0px; list-style: none;">东水门长江大桥+千厮门嘉陵江大桥</span></p><p align="center" style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;"><img id="31406747" title="点击图片浏览更多精彩内容" border="0" align="center" src="http://i2.cqnews.net/life/attachement/jpg/site82/20151125/b8aeed9d94bd17bfae6940.jpg" sourcename="本地文件" sourcedescription="编辑提供的本地文件" alt="点击图片浏览更多精彩内容" style="border-style: none; margin: 0px; padding: 0px; list-style: none; cursor: pointer;"></p><p align="center" style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;"><img id="31406750" title="点击图片浏览更多精彩内容" border="0" align="center" src="http://i3.cqnews.net/life/attachement/jpg/site82/20151125/b8aeed9d94bd17bfae6d41.jpg" sourcename="本地文件" sourcedescription="编辑提供的本地文件" alt="点击图片浏览更多精彩内容" style="border-style: none; margin: 0px; padding: 0px; list-style: none; cursor: pointer;"></p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;东水门长江大桥于2014年3月竣工，千厮门嘉陵江大桥于2014年6月竣工，协调一致的结构布置使两江四岸连成一个整体，而且是世界上首座“双子桥”。</p>','0','1','["http:\\/\\/pic.jiushang.cn\\/upload\\/web_app\\/11\\/2017\\/10\\/23\\/fZ2yyGhFDc.JPG"]'),
('74','习近平代表第十八届中央委员会向党的十九大作报告','3','6',null,'新华网','2017-10-18 10:02:53','<p align="center" style="margin-bottom: 15px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; background: transparent; font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, 微软雅黑, STHeitiSC-Light, simsun, 宋体, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif;"><img id="{41D616CA-8CC0-401C-85C6-07F0012D02F7}" title="" border="0" src="http://news.xinhuanet.com/politics/19cpcnc/2017-10/17/1121817850_15082496346441n.jpg" sourcename="本地文件" sourcedescription="编辑提供的本地文件" style="margin: 0px; padding: 0px; outline: 0px; vertical-align: baseline; background: transparent; max-width: 100%; height: 713px; width: 900px;"></p><p style="margin-bottom: 15px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; background: transparent; font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, 微软雅黑, STHeitiSC-Light, simsun, 宋体, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif;"><font color="navy" face="楷体">　　10月17日，中国共产党第十九次全国代表大会主席团在北京人民大会堂举行第一次会议。习近平同志出席会议并作重要讲话。新华社记者 兰红光 摄</font></p><p style="margin-bottom: 15px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; background: transparent; font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, 微软雅黑, STHeitiSC-Light, simsun, 宋体, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif;">　　新华社北京10月17日电 中国共产党第十九次全国代表大会主席团17日下午在人民大会堂举行第一次会议。</p><p style="margin-bottom: 15px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; background: transparent; font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, 微软雅黑, STHeitiSC-Light, simsun, 宋体, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif;">　　习近平同志出席会议并作了重要讲话。</p><p style="margin-bottom: 15px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; background: transparent; font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, 微软雅黑, STHeitiSC-Light, simsun, 宋体, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif;">　　会议首先在大会秘书长刘云山主持下，以举手表决方式通过了由习近平同志等42人组成的主席团常务委员会名单。</p><p style="margin-bottom: 15px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; background: transparent; font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, 微软雅黑, STHeitiSC-Light, simsun, 宋体, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif;">　　随后，会议在习近平同志主持下进行了各项议程。会议以举手表决方式通过了刘奇葆、孟建柱、赵乐际、栗战书为大会副秘书长。</p><p style="margin-bottom: 15px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; background: transparent; font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, 微软雅黑, STHeitiSC-Light, simsun, 宋体, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif;">　　会议通过了中国共产党第十九次全国代表大会代表资格审查委员会关于代表资格的审查报告。</p><p style="margin-bottom: 15px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; background: transparent; font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, 微软雅黑, STHeitiSC-Light, simsun, 宋体, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif;">　　报告说，全国各选举单位选举产生并经中央批准公布代表共2287名。经审查，确认2280名代表资格有效。大会应出席代表2280名。</p><p style="margin-bottom: 15px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; background: transparent; font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, 微软雅黑, STHeitiSC-Light, simsun, 宋体, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif;">　　报告说，以习近平同志为核心的党中央高度重视十九大代表选举工作。从去年11月开始，在党中央的正确领导下，各选举单位严格遵循党章，坚持党的性质，加强党的领导，突出政治标准和先进性，注重改善代表结构，规范代表产生程序，充分发扬党内民主，严格审核把关，严肃选举纪律，扎实做好代表选举各项工作。</p><p style="margin-bottom: 15px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; background: transparent; font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, 微软雅黑, STHeitiSC-Light, simsun, 宋体, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif;">　　报告说，在代表选举产生过程中，全国基层党组织参与基本实现了全覆盖，党员参与率达到99.2%。各选举单位坚持自下而上、上下结合、反复酝酿、逐级遴选，充分听取基层党组织、党代表和广大党员的意见；坚持把政治标准放在第一位，严把代表政治关；严格落实“四必”要求，对所有考察对象的档案材料进行了认真审核，党风廉政情况征求了纪检机关的意见，对来信来访线索具体的均认真调查核实，对人选中党员领导干部个人有关事项进行了查核。根据征求意见和核查情况，对不宜作代表人选的进行了调整；准确认定人选身份，坚决防止“顶帽子”。各选举单位召开党委全体会议或党委（党组）扩大会议，以投票方式确定代表候选人预备人选。除西藏、新疆经中央批准实行等额选举外，各选举单位召开党代表大会或党代表会议差额选举出席党的十九大代表，差额比例均多于15%，符合中央要求。代表选举产生后，通过中央主要新闻媒体，采取多种形式报道了代表选举工作情况。</p><p style="margin-bottom: 15px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; background: transparent; font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, 微软雅黑, STHeitiSC-Light, simsun, 宋体, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif;">　　报告说，十九大代表总体上符合中央规定的条件，具有较高的思想政治素质、良好的作风品行和较强的议事能力，在各自岗位上做出了显著成绩，是共产党员中的优秀分子。代表结构与分布比较合理。生产和工作第一线党员代表比例明显提高，女党员代表、少数民族党员代表数量增加，代表学历层次较高，年龄结构合理，有不同历史时期入党的党员。十九大代表各项结构比例均符合中央要求，具有广泛的代表性。</p><p style="margin-bottom: 15px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; background: transparent; font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, 微软雅黑, STHeitiSC-Light, simsun, 宋体, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif;">　　报告说，参照十八大时的做法，中央确定了74名特邀代表出席党的十九大，特邀代表享有代表同等权利。</p><p style="margin-bottom: 15px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; background: transparent; font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, 微软雅黑, STHeitiSC-Light, simsun, 宋体, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif;">　　会议通过了中国共产党第十九次全国代表大会选举办法（草案），提交各代表团酝酿。</p><p style="margin-bottom: 15px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; background: transparent; font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, 微软雅黑, STHeitiSC-Light, simsun, 宋体, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif;">　　会议还通过了列席和来宾事项。中央决定，邀请党内有关负责同志和部分党外人士列席大会。列席大会的有：不是十九大代表的十八届中央委员会委员、候补委员和中央纪律检查委员会委员，不是十九大代表、特邀代表的原中央顾问委员会委员，以及其他有关同志，共405人。作为来宾列席大会开幕会和闭幕会的有：现任和曾任全国人大常委会副委员长、全国政协副主席的党外人士，在京各民主党派中央、全国工商联副主席，无党派代表人士，宗教界代表人士，在京全国人大、全国政协常委中的民主党派、无党派和民族宗教界人士，共149人。</p><p style="margin-bottom: 15px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; background: transparent; font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, 微软雅黑, STHeitiSC-Light, simsun, 宋体, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif;">　　主席团会议还通过了十九大的日程。根据这个日程，十九大将于10月18日上午开幕，10月24日上午闭幕。</p><p style="margin-bottom: 15px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; background: transparent; font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, 微软雅黑, STHeitiSC-Light, simsun, 宋体, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif;"><br></p><p style="margin-bottom: 15px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; background: transparent; font-family: &quot;PingFang SC&quot;, &quot;Lantinghei SC&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Microsoft YaHei&quot;, 微软雅黑, STHeitiSC-Light, simsun, 宋体, &quot;WenQuanYi Zen Hei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif;"><br></p>','0','1','["http:\\/\\/pic.jiushang.cn\\/upload\\/web_app\\/11\\/2017\\/10\\/24\\/85BMDnkKGX.png"]'),
('80','大商云集——第97届全国糖酒会参展企业先睹为快','1','2','单图','全国糖酒会','2017-10-24 10:33:23','<p class="p1"><span class="s1">11月10-12日，第97届全国糖酒商品交易会即将在重庆国际博览中心举办，距离本届秋糖开幕，还有二十余天时间。截止目前，已有来自四十多个国家和地区的近三千家展商确认参展，招商工作基本进入尾声。此外，本届全国糖酒会的各项筹备工作，也在紧锣密鼓地进行。</span></p><p class="p1"><span class="s1">本届会规划面积15.6万平方米，使用了重庆国际博览中心12个展馆及中央大厅、中央登录厅，分设酒类展区（中央大厅、中央登录厅中间区域）、食品及饮料展区（N1、N3、N5、N7、N8，S1）、葡萄酒及国际烈酒展区（S2、S3、S4）、调味品展区（N2、N4部分区域）、包装展区（中央登录厅左右两侧区域）、食品机械展区（N4部分区域、N6），并在各展区内根据细分品类及采购商需求，设立了国际啤酒、酒具、进口食品、餐饮连锁、国际食品机械、电商、金融服务、休闲食品、农产品、森林食品、科技及新品等小型特色专区。</span></p><p class="p1"><span class="s1">诸多行业内知名企业踊跃参展，整体上呈现出国际化程度稳步提升，龙头企业领衔，中小企业群星赶月的良好参展氛围，</span></p><p class="p1"><span class="s1">持续强劲的葡萄酒及国际烈酒。在欧洲大部分地区的葡萄酒饮用量停滞不前甚至下降之时，随着亚洲消费者对于葡萄酒及国际烈酒的认识日深，以及中国老百姓的消费升级，行业需求持续强劲。顺应亚洲市场需求，法国南部、意大利、香港等将以国家展团的形式组团参展本届糖酒会，此外，厦门百世利、澳洲天鹅、意大利cevico、上海卡斯特、名饮国际、深圳鹰君、凯洛酒庄、上海杰莎、天津欢乐颂、歌德盈香、厦门迈西玛、广州心居、澳洲三洋、深圳美的君兰、名品世家、德堡啤酒、澳洲太平洋、广州融生、ADVINI、广州十六区、中食合众、上海班提等知名国际品牌和业内领先进出口贸易商也将闪耀秋糖。</span></p><p class="p1"><span class="s1">量价齐升的白酒新周期。国庆假期后，白酒板块强势上涨，渠道库存不断拉低，经销商信心十足。在高端酒抬头后，次高端和中端酒也将继续拓宽商机。本届秋糖汇聚了以茅台集团、汾酒集团、酒鬼酒、衡水老白干、国台、金东集团（华泽）、江小白、小村外等实力强劲的传统白酒企业，以及绍兴会稽山、力源酒业等黄酒、保健酒板块的领军企业，同时也有酒仙网、华致酒行知名贸易酒商到会参展。</span></p><p class="p1"><span class="s1">砥砺奋进的食品饮料产业革新。2017年是经销商的洗牌年，也是厂家的优胜劣汰年，数月来，产业升级已经成为食品人的主旋律。能在这波产业升级中继续加大推广力度和完善经销商体系的企业，实力毋庸置疑。中粮番茄、中国茶叶、山东一品堂、北京同仁堂、广东广粮、完达山、好彩头食品、三匠苦荞、优洋饮品、明远食品、安徽致养、河南太子奶、蜀大侠、河北栗源、河南蓝图、湖南克明可味、成都致力维格、东阿古胶阿胶等国内知名企业将莅临重庆，为业内展示食品和饮料标杆企业形象。</span></p><p class="p1"><span class="s1">深入腹地的调味品产业链。作为重庆市七大重点产业链之一的调味品产业，在这个调味品消费和制造大区有着得天独厚的产能优势。借着本届秋糖落地重庆的东风，各大调味品企业纷纷蓄力展示推广。中粮工食、紫林醋业、安琪酵母、德庄火锅、重庆秋霞、山河醋业、重庆自家厨房、川陴豆瓣、成都扬名食品、重庆好哥们、重庆朝天门、重庆味中皇、重庆秦妈、重庆德宜信、重庆饭巢、四川老坛子、重庆佳仙等来自西南和国内其他省市的调味品企业均将集中最优质的产品在本届糖酒会闪亮登场。</span></p><p class="MsoNormal">




<style type="text/css">
p.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 12.0px \'Hannotate SC\'; -webkit-text-stroke: #000000}
span.s1 {font-kerning: none}
</style>









</p><p class="p1"><span class="s1">渠道下沉的进口食品大军。前十年主要聚焦沿海城市和1-2线城市的进口食品，已经开始重点争夺3-4线城市市场，如何培养新兴市场的进口食品经销商和中小型销售渠道显得尤为重要。借着秋糖再现重庆的东风，澳大利亚、泰国、韩国、台湾等均以国家展团的形式组团参展本届糖酒会，其他知名进口食品如中商、洋一、九日、益马昌东方快船（禾格佳尚）、好伙伴等也将悉数参展。</span></p><p class="MsoNormal"><span lang="EN-US"><o:p></o:p></span></p><p class="MsoNormal"><span lang="EN-US"><o:p></o:p></span></p><p class="MsoNormal"><span lang="EN-US"><o:p></o:p></span></p><style>
