('83','这是多图模式的测试','1','3','多图','陈琳','2017-10-24 11:45:08','<p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: DengXian; text-align: justify;"><span style="font-size: 9pt; font-family: &quot;Microsoft YaHei Light&quot;;"><span style="font-size: 14px;">重庆新地标第一名，蝴蝶状的重庆国博中心在悦来新城展翅欲飞，成为重庆建设会展之都的重要载体。</span><span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: DengXian; text-align: justify;"><span style="font-size: 9pt; font-family: &quot;Microsoft YaHei Light&quot;;"><span style="font-size: 14px;">作为两江新区内陆开放的核心平台之一，悦来会展平台与保税港、空港、水港、信息港在</span><span lang="EN-US" style="font-size: 14px;">20</span><span style="font-size: 14px;">平方公里的半径内，互联互通、交相辉映，成为重庆连接世界的窗口和舞台。</span></span></p><p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: DengXian; text-align: justify;"><br></p><p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: DengXian; text-align: justify;"><span style="font-size: 9pt; font-family: &quot;Microsoft YaHei Light&quot;;"><span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoListParagraph" align="left" style="margin: 0cm 0cm 0.0001pt 18pt; font-size: 12pt; font-family: DengXian; text-indent: -18pt;"><span style="font-weight: 700;"><span lang="EN-US" style="font-size: 9pt;"><span style="font-stretch: normal; font-size: 14px; line-height: normal;"><font face="Microsoft YaHei Light">一、</font></span><span style="font-family: &quot;Times New Roman&quot;; font-stretch: normal; font-size: 14px; line-height: normal;">&nbsp;</span></span></span><span style="font-size: 9pt; font-family: &quot;Microsoft YaHei Light&quot;; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size: 14px;"><span style="font-weight: 700;">这里，硬件条件全国屈指可数</span></span><span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: DengXian; text-align: justify; line-height: 21pt;"><span style="font-size: 9pt; font-family: &quot;Microsoft YaHei Light&quot;;"><span style="font-size: 14px;">国博中心主体结构如蝴蝶的两翼，左右对称展开。场馆室内展览面积</span><span lang="EN-US" style="font-size: 14px;">20</span><span style="font-size: 14px;">万平米，共</span><span lang="EN-US" style="font-size: 14px;">16</span><span style="font-size: 14px;">个全平层无柱式展厅，室外展场</span><span lang="EN-US" style="font-size: 14px;">5.8</span><span style="font-size: 14px;">万平米，停车位共计约</span><span lang="EN-US" style="font-size: 14px;">1.1</span><span style="font-size: 14px;">万个。</span><span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: DengXian; text-align: justify; line-height: 21pt;"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;">2016</span><span style="font-size: 9pt; font-family: &quot;Microsoft YaHei Light&quot;;"><span style="font-size: 14px;">年，国博中心共举办展览</span><span lang="EN-US" style="font-size: 14px;">25</span><span style="font-size: 14px;">个，各类活动</span><span lang="EN-US" style="font-size: 14px;">39</span><span style="font-size: 14px;">场，会议及宴会</span><span lang="EN-US" style="font-size: 14px;">205</span><span style="font-size: 14px;">场。其中，国际性展览数量</span><span lang="EN-US" style="font-size: 14px;">4</span><span style="font-size: 14px;">个，同比增长</span><span lang="EN-US" style="font-size: 14px;">25%</span><span style="font-size: 14px;">，国际性会议</span><span lang="EN-US" style="font-size: 14px;">15</span><span style="font-size: 14px;">场，同比增长</span><span lang="EN-US" style="font-size: 14px;">7%</span><span style="font-size: 14px;">。</span></span></p><p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: DengXian; text-align: justify; line-height: 21pt;"><img src="http://pic.jiushang.cn/upload/admin_app/109/2017/10/27/ps72tRtyrr.png" style="width: 532px;"><span style="font-size: 9pt; font-family: &quot;Microsoft YaHei Light&quot;;"><span style="font-size: 14px;"><br></span></span></p><p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: DengXian; text-align: justify; line-height: 21pt;"><span style="font-size: 9pt; font-family: &quot;Microsoft YaHei Light&quot;;"><span style="font-size: 14px;"><br></span><span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoListParagraph" align="left" style="margin: 0cm 0cm 0.0001pt 18pt; font-size: 12pt; font-family: DengXian; text-indent: -18pt;"><span style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-weight: 700;">二、这里，群星璀璨星光闪耀</span></span><span lang="EN-US" style="font-size: 9pt; font-family: &quot;Microsoft YaHei Light&quot;;"><o:p></o:p></span></p><p class="MsoNormal" align="left" style="margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: DengXian;"><span style="font-size: 9pt; font-family: &quot;Microsoft YaHei Light&quot;; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size: 14px;">在国博中心的正中，是中央大厅。这里使用面积</span><span lang="EN-US" style="font-size: 14px;">2</span><span style="font-size: 14px;">万平方米，净高约</span><span lang="EN-US" style="font-size: 14px;">20</span><span style="font-size: 14px;">米，可容纳</span><span lang="EN-US" style="font-size: 14px;">1.5</span><span style="font-size: 14px;">万个座位，可举办演出、体育赛事、超大会议等多种大型室内活动。中央大厅以其优质的音响效果、便捷的交通组织受到各方好评，成为西部重要的演出场馆之一。</span></span></p><p class="MsoNormal" align="left" style="margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: DengXian;"><img src="http://pic.jiushang.cn/upload/admin_app/109/2017/10/27/2ajYjWcSAm.png" style="width: 533px;"><span style="font-size: 9pt; font-family: &quot;Microsoft YaHei Light&quot;; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size: 14px;"><br></span></span></p><p class="MsoNormal" align="left" style="margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: DengXian;"><span style="font-size: 9pt; font-family: &quot;Microsoft YaHei Light&quot;; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-weight: 700;"><span style="font-size: 14px;"><br></span><span lang="EN-US"><o:p></o:p></span></span></span></p><p class="MsoListParagraph" align="left" style="margin: 0cm 0cm 0.0001pt 18pt; font-size: 12pt; font-family: DengXian; text-indent: -18pt;"><span style="font-weight: 700;"><span style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">三、这里，智慧建设全国领先</span></span><span lang="EN-US" style="font-size: 9pt; font-family: &quot;Microsoft YaHei Light&quot;;"><o:p></o:p></span></p><p style="margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: &quot;Times New Roman&quot;; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-align: justify; line-height: 21pt;"><span style="font-size: 9pt; font-family: &quot;Microsoft YaHei Light&quot;;"><span style="font-size: 14px;">国博中心从建立之初就致力于打造“中国最好用的场馆”，为观众提供最便捷的服务。</span><span lang="EN-US"><o:p></o:p></span></span></p><p style="margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: &quot;Times New Roman&quot;; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-align: justify; line-height: 21pt; max-width: 100%; min-height: 1em; word-wrap: break-word !important;"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;">2016</span><span style="font-size: 9pt; font-family: &quot;Microsoft YaHei Light&quot;;"><span style="font-size: 14px;">年，这里的“智慧体验”进一步升级。国博中心完成了自助租赁系统的开发和建设，提高自身服务效率，提升了客户的参展体验度。</span><span lang="EN-US" style="font-size: 14px;">WIFI</span><span style="font-size: 14px;">认证系统全年正常运行，全年累计提供超过</span><span lang="EN-US" style="font-size: 14px;">10</span><span style="font-size: 14px;">万人次的服务并收集有效用户大数据近</span><span lang="EN-US" style="font-size: 14px;">8</span><span style="font-size: 14px;">万条。全新打造的智慧</span><span lang="EN-US" style="font-size: 14px;">VR</span><span style="font-size: 14px;">直播系统，实现了</span><span lang="EN-US" style="font-size: 14px;">720</span><span style="font-size: 14px;">度</span><span lang="EN-US" style="font-size: 14px;">VR</span><span style="font-size: 14px;">直播看展，打破了传统的网上图文看展的模式。</span><span lang="EN-US"><o:p></o:p></span></span></p><p style="margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: &quot;Times New Roman&quot;; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-align: justify; line-height: 21pt;"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;"><o:p>&nbsp;</o:p></span><img src="http://pic.jiushang.cn/upload/admin_app/109/2017/10/27/SN6xkNExSH.png" style="width: 532px;"></p><p style="m