ckground-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">车</span><span style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">北站</span><span style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">对</span><span style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">面，与交投会</span><span style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">议</span><span style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">酒店和立天酒店构成了酒</span><span style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">类</span><span style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">金三角。其</span><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">14</span><span style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">年没有布展，</span><span style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">经销</span><span style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">商熟知度不高，但因</span><span style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">为</span><span style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">其档次高，一部分参展商</span><span style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">还</span><span style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">是比</span><span style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">较</span><span style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">喜</span><span style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">欢</span><span style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">在此</span><span style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">设</span><span style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">展。</span></p>','1','1','["http:\\/\\/pic.jiushang.cn\\/upload\\/web_app\\/11\\/2017\\/10\\/25\\/y3R3xH7dec.png","http:\\/\\/pic.jiushang.cn\\/upload\\/web_app\\/11\\/2017\\/10\\/25\\/iBtRxiNW62.MOV"]'),
('86','大商云集——第97届全国糖酒会参展企业先睹为快','1','2','单图','全国糖酒会','2017-10-25 10:18:35','<p class="MsoNormal"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;">9</span><span style="font-size: 10.5pt; font-family: &quot;Microsoft YaHei Light&quot;;">月，<span lang="EN-US">2017</span>全国光瓶酒领袖大会登陆秋糖的计划曝光，一石激起千层浪，称快者有之，怀疑者有之。在中国酒业<span lang="EN-US">30</span>多年的发展历程里，每一次引领产业突破和升级的都是中高端酒之功。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;"><o:p>&nbsp;</o:p></span></p><p class="MsoNormal"><span style="font-size: 10.5pt; font-family: &quot;Microsoft YaHei Light&quot;;">但<span lang="EN-US">2012</span>年以后，中国酒业进入深度调整期，光瓶酒顺应了大众酒时代需求，成为行业去产能和高增长的重要力量。老村长、牛栏山进入中国酒业前十，玻汾、老窖二曲、贵宾郎单品爆发，江小白、西凤<span lang="EN-US">375</span>、小村外异军突起。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;"><o:p>&nbsp;</o:p></span></p><p class="MsoNormal"><span style="font-size: 10.5pt; font-family: &quot;Microsoft YaHei Light&quot;;">当行业对<span lang="EN-US">“</span>名酒与民酒<span lang="EN-US">”</span>达成和解之后，光瓶酒俨然成为增长最为稳定和最快的品类。不过从转折点的<span lang="EN-US">2017</span>年来看，整个中国酒业<span lang="EN-US">“</span>一高一低<span lang="EN-US">”</span>的发展趋势均明显优于腰部价格带的产品。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;"><o:p>&nbsp;</o:p></span></p><p class="MsoNormal"><span style="font-size: 10.5pt; font-family: &quot;Microsoft YaHei Light&quot;;">而以时尚、个性、品质为特征的新周期，光瓶酒掀起了升级大战，高线光瓶酒挤压着低端盒酒的市场，稳步增长态势十分明朗。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;"><o:p>&nbsp;</o:p></span></p><p class="MsoNormal"><span style="font-size: 10.5pt; font-family: &quot;Microsoft YaHei Light&quot;;">甚至可以说光瓶酒重新夺回了品类优越感。新食品杂志社副社长向宁这样定义这一周期的变化：光瓶酒可以重新定义刚需市场，拒绝升级和拒绝消费者就是拒绝未来。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;"><o:p>&nbsp;</o:p></span></p><p class="MsoNormal"><span style="font-size: 10.5pt; font-family: &quot;Microsoft YaHei Light&quot;;">所以，<span lang="EN-US">2017</span>年秋季糖酒会，全国光瓶酒领袖大会来了！</span></p><p class="MsoNormal"><img src="http://pic.jiushang.cn/upload/admin_app/109/2017/10/27/rJhhYyGwWK.png" style="width: 456px;"><span style="font-size: 10.5pt; font-family: &quot;Microsoft YaHei Light&quot;;"><br><span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;"><o:p>&nbsp;</o:p></span></p><p class="MsoNormal"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;">1</span><span style="font-size: 10.5pt; font-family: &quot;Microsoft YaHei Light&quot;;">、光瓶不低端，需求是王道，我们为其正名<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;"><o:p>&nbsp;</o:p></span></p><p class="MsoNormal"><span style="font-size: 10.5pt; font-family: &quot;Microsoft YaHei Light&quot;;">光瓶酒一定是低端的吗？光瓶酒的表现形式只能是劣质吗？答案肯定是否定的。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;"><o:p>&nbsp;</o:p></span></p><p class="MsoNormal"><span style="font-size: 10.5pt; font-family: &quot;Microsoft YaHei Light&quot;;">相反，光瓶酒已经成为酒类创新的集中营。相比较为了拔高价格而做出的所谓文化、历史的创新，因为负担更轻，光瓶酒的创新更在于他对于品质、口感、度数、包装方面的探索。不过，<span lang="EN-US">2017</span>年的光瓶酒又出现了一个全新词汇：时尚。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;"><o:p>&nbsp;</o:p></span></p><p class="MsoNormal"><span style="font-size: 10.5pt; font-family: &quot;Microsoft YaHei Light&quot;;">为了体现光瓶酒在升级之中做体现的正能量，敬畏品类和行业创新，新食品杂志社围绕本次大会，设计了高大上的现场表现。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;"><o:p>&nbsp;</o:p></span></p><p class="MsoNormal"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;">2</span><span style="font-size: 10.5pt; font-family: &quot;Microsoft YaHei Light&quot;;">、联袂京东与卓鹏，平台式助力未来思考<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><img src="http://pic.jiushang.cn/upload/admin_app/109/2017/10/27/6FwFshtYAn.png" style="width: 497px;"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;"><o:p><br></o:p></span></p><p class="MsoNormal"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;"><o:p>&nbsp;</o:p></span></p><p class="MsoNormal"><span style="font-size: 10.5pt; font-family: &quot;Microsoft YaHei Light&quot;;">经销商的迷茫，来源于商业趋势和商业模式的错综复杂，低效的管理和沟通不足以支撑经销商在当下商业环境中赢得先机。如果要选彻底转型，有两项工程十分重要：认清趋势<span lang="EN-US">+</span>打通通路。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;"><o:p>&nbsp;</o:p></span></p><p class="MsoNormal"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;"><o:p>&nbsp;</o:p></span></p><p class="MsoNormal"><span style="font-size: 10.5pt; font-family: &quot;Microsoft YaHei Light&quot;;">在<span lang="EN-US">2017</span>全国光瓶酒领袖大会期间，组委会将为运营光瓶酒或志在进入大众酒领域的经销商提供系统的头脑风暴。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;"><o:p>&nbsp;</o:p></span></p><p class="MsoNormal"><span style="font-size: 10.5pt; font-family: &quot;Microsoft YaHei Light&quot;;">一、认清趋势：新食品杂志社联合卓鹏战略调研<span lang="EN-US">3</span>月而成首个《高线光瓶酒白皮书》现场发布。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;"><o:p>&nbsp;</o:p></span></p><p class="MsoNormal"><span style="font-size: 10.5pt; font-family: &quot;Microsoft YaHei Light&quot;;">二、打通通路：京东商城新通路事业部经营战略部总经理吴双喜现场分享酒业的通路创新。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;"><o:p>&nbsp;</o:p></span></p><p class="MsoNormal"><span style="font-size: 10.5pt; font-family: &quot;Microsoft YaHei Light&quot;;">三、头脑风暴：光瓶酒领袖企业代表两轮关于大众酒的激辩式对话带您认清产业趋势。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;"><o:p>&nbsp;</o:p></span></p><p class="MsoNormal"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;">3</span><span style="font-size: 10.5pt; font-family: &quot;Microsoft YaHei Light&quot;;">、首个以光瓶酒为主题的文化创意展<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;"><o:p>&nbsp;</o:p></span></p><p class="MsoNormal"><span style="font-size: 10.5pt; font-family: &quot;Microsoft YaHei Light&quot;;">一直以来，全国糖酒会的酒店展只会以酒类、食品等进行分类，酒类中再以白酒、葡萄酒两大类切分。真正能够引起经销商群体关注，也仅集中在茅台、五粮液、洋河、泸州老窖、汾酒等集中参展的集团。若以品类来看，还无其他主题展。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;"><o:p>&nbsp;</o:p></span></p><p style="font-size: 12px;"><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span><span style="font-size: 14px;"></span></p><p class="MsoNormal"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;">2017</span><span style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;">秋季糖酒会，迎合大众酒升级趋势，在全国光瓶酒领袖大会召开同期，组委会特邀了全国光瓶酒领域真正的代表性企业和产品，以领袖和明星的概念，共同打造糖酒会史上首个专业关注光瓶酒展览的文化创意展。</span></p><style><span style="font-size: 14px;">
