('88','重庆秋糖倒计时，内附参展酒店详细地址及交通路线','2','2','单图','酒商网','2017-10-31 09:55:48','<p class="MsoNormal" align="left" style="margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: DengXian; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size: 9pt; font-family: &quot;DengXian Light&quot;;"><span style="font-size: 14px;">第</span><span lang="EN-US" style="font-size: 14px;">97</span><span style="font-size: 14px;">届全国秋季糖酒会将于</span><span lang="EN-US" style="font-size: 14px;">11</span><span style="font-size: 14px;">月初在重庆召开，经常参加糖酒会的朋友都知道每年春季固定在成都召开，秋季由不同的城市申办，所以相对于秋糖来说大家对秋季城市都是陌生的，不过重庆也是第三次举办全国糖酒会，相信大家也不陌生，今天小编就把整理好的各个布展酒店的详细地址及乘车路线奉上，祝参会企业重庆收获多多。</span></span></p><p style="font-size: 12px;"><img src="http://pic.jiushang.cn/upload/admin_app/109/2017/10/26/zhnSRAafCR.png" style="width: 654px;"></p><p style="font-size: 12px;"><br></p><p style="font-size: 12px;"><span style="color: rgb(62, 62, 62); font-family: &quot;Microsoft YaHei&quot;; font-size: 18px; text-align: center;"><span style="font-weight: 700;">【酒水专区】</span></span></p><p style="font-size: 12px;"><br></p><p style="margin: 0cm 0cm 0.0001pt; font-size: 12px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;">1</span><span style="font-size: 9pt; font-family: &quot;Microsoft YaHei Light&quot;;"><span style="font-size: 14px;">、重庆伊可莎大酒店</span><span lang="EN-US"><o:p></o:p></span></span></p><p style="margin: 0cm 0cm 0.0001pt; font-size: 12px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: in