('90','重庆十大最美桥梁 你去过几座','2','4','大图','tjh','2017-10-31 10:00:48','<p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;重庆有“中国桥都”之称， 拥有大小桥梁1.3万多座，桥型众多，也被喻为“万桥之都”。桥，已经成为重庆一张靓丽的城市名片。首届重庆十大最美桥梁评选结果已经出炉了，该活动是由市桥梁协会、重庆晨报主办，先期推选出了20座候选桥梁，再由市民及桥梁专家进行投票筛选得出，快来看看这些桥梁，你去过几座？</p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-weight: 700; margin: 0px; padding: 0px; list-style: none;">石板坡长江大桥+石板坡大桥复线桥</span></p><p align="center" style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;"></p><p align="center" style="margin-bottom: 30px; font-family: 宋体; list-style: none; font-size: 12px; line-height: 20px; width: 650px; overflow: hidden; height: 20px; color: rgb(0, 51, 153);">点击图片查看下一页</p><p><img id="31406723" title="点击图片进入下一页" border="0" align="center" src="http://i3.cqnews.net/life/attachement/jpg/site82/20151125/b8aeed9d94bd17bfae2b37.jpg" sourcename="本地文件" sourcedescription="编辑提供的本地文件" alt="点击图片进入下一页" style="border-style: none; font-family: 宋体; font-size: 16px; margin: 0px; padding: 0px; list-style: none; cursor: pointer;"></p><p style="font-family: 宋体; font-size: 16px;"></p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;石板坡长江大桥桥头现有春、夏、秋、冬四座大型铝合金塑像。石板坡长江大桥复线桥主跨是目前世界同类型桥梁中跨径最大的。</p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-weight: 700; margin: 0px; padding: 0px; list-style: none;">万州长江公路大桥</span></p><p align="center" style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;"><img id="31406725" title="点击图片进入下一页" border="0" align="center" src="http://i4.cqnews.net/life/attachement/jpg/site82/20151125/b8aeed9d94bd17bfae3338.jpg" sourcename="本地文件" sourcedescription="编辑提供的本地文件" alt="点击图片进入下一页" style="border-style: none; margin: 0px; padding: 0px; list-style: none; cursor: pointer;"></p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;大桥全长856米，桥高147米(枯水位以上)，1997年5月竣工，是当时世界上跨径和规模最大的钢筋混凝土拱桥。</p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-weight: 700; margin: 0px; padding: 0px; list-style: none;">鹅公岩长江大桥</span></p><p align="center" style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;"><img id="31406729" title="点击图片进入下一页" border="0" align="center" src="http://i1.cqnews.net/life/attachement/jpg/site82/20151125/b8aeed9d94bd17bfae3d39.jpg" sourcename="本地文件" sourcedescription="编辑提供的本地文件" alt="点击图片进入下一页" style="border-style: none; margin: 0px; padding: 0px; list-style: none; cursor: pointer;"></p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;鹅公岩大桥连接九龙坡区和南岸区，双向六车道，高耸的门型双塔成为城市一大景观！大桥悬索还漆上了漂亮的朱红色，被市民誉为“主城最美大桥”！</p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-weight: 700; margin: 0px; padding: 0px; list-style: none;">菜园坝长江大桥</span></p><p align="center" style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;"><img id="31406731" title="点击图片进入下一页" border="0" align="center" src="http://i2.cqnews.net/life/attachement/jpg/site82/20151125/b8aeed9d94bd17bfae403a.jpg" sourcename="本地文件" sourcedescription="编辑提供的本地文件" alt="点击图片进入下一页" style="border-style: none; margin: 0px; padding: 0px; list-style: none; cursor: pointer;"></p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;菜园坝大桥位于两路口到南坪之间的江水之上，整座桥采用环保的防腐涂装，两道橘红色的“飞虹”异常醒目，是目前国内最大的公共交通和城市轻轨两用大跨径拱桥，也是世界第一座采用缆索吊机安装的大桥。</p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-weight: 700; margin: 0px; padding: 0px; list-style: none;">大宁河特大桥</span></p><p align="center" style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;"><img id="31406733" title="点击图片进入下一页" border="0" align="center" src="http://i3.cqnews.net/life/attachement/jpg/site82/20151125/b8aeed9d94bd17bfae443b.jpg" sourcename="本地文件" sourcedescription="编辑提供的本地文件" alt="点击图片进入下一页" style="border-style: none; margin: 0px; padding: 0px; list-style: none; cursor: pointer;"></p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;大桥全长682米，建设时主桥跨径规模居同类型拱桥世界第二、中国第一。荣获2011年重庆市科技进步二等奖。</p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-weight: 700; margin: 0px; padding: 0px; list-style: none;">朝天门长江大桥</span></p><p align="center" style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;"><img id="31406735" title="点击图片进入下一页" border="0" align="center" src="http://i4.cqnews.net/life/attachement/jpg/site82/20151125/b8aeed9d94bd17bfae483c.jpg" sourcename="本地文件" sourcedescription="编辑提供的本地文件" alt="点击图片进入下一页" style="border-style: none; margin: 0px; padding: 0px; list-style: none; cursor: pointer;"></p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;朝天门长江大桥位于重庆主城区，西连江北五里店，东接南岸弹子石，主跨为世界跨径最大的拱桥。这座桥不管是白天还是黑夜看起来都非常宏伟壮观。</p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-weight: 700; margin: 0px; padding: 0px; list-style: none;">江津观音岩长江大桥</span></p><p align="center" style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;"><img id="31406737" title="点击图片进入下一页" border="0" align="center" src="http://i1.cqnews.net/life/attachement/jpg/site82/20151125/b8aeed9d94bd17bfae4e3d.jpg" sourcename="本地文件" sourcedescription="编辑提供的本地文件" alt="点击图片进入下一页" style="border-style: none; margin: 0px; padding: 0px; list-style: none; cursor: pointer;"></p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;桥全长1198.94米，是高速公路上第一座跨长江的钢混组合梁斜拉桥，获2011年重庆市科技进步二等奖。</p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;<span style="font-weight: 700; margin: 0px; padding: 0px; list-style: none;">嘉悦嘉陵江大桥</span></p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;"><img id="31406740" title="点击图片浏览更多精彩内容" border="0" align="center" src="http://i4.cqnews.net/life/attachement/jpg/site82/20151125/b8aeed9d94bd17bfae5d3e.jpg" sourcename="本地文件" sourcedescription="编辑提供的本地文件" alt="点击图片浏览更多精彩内容" style="border-style: none; margin: 0px; padding: 0px; list-style: none; cursor: pointer;"></p><p style="font-family: 宋体; font-size: 16px;"></p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;大桥全长774米，2010年2月竣工，大桥分上下两层，为重庆首座埃塔斜拉桥，获第十一届中国土木工程詹天佑奖。</p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-weight: 700; margin: 0px; padding: 0px; list-style: none;">江津鼎山长江大桥</span></p><p align="center" style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;"><img id="31406744" title="点击图片浏览更多精彩内容" border="0" align="center" src="http://i1.cqnews.net/life/attachement/jpg/site82/20151125/b8aeed9d94bd17bfae623f.jpg" sourcename="本地文件" sourcedescription="编辑提供的本地文件" alt="点击图片浏览更多精彩内容" style="border-style: none; margin: 0px; padding: 0px; list-style: none; cursor: pointer;"></p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;大桥为双塔双索面公轨两用斜拉桥，塔柱高188.3米，是长江中上游第一座公轨两用斜拉桥。</p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-weight: 700; margin: 0px; padding: 0px; list-style: none;">东水门长江大桥+千厮门嘉陵江大桥</span></p><p align="center" style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;"><img id="31406747" title="点击图片浏览更多精彩内容" border="0" align="center" src="http://i2.cqnews.net/life/attachement/jpg/site82/20151125/b8aeed9d94bd17bfae6940.jpg" sourcename="本地文件" sourcedescription="编辑提供的本地文件" alt="点击图片浏览更多精彩内容" style="border-style: none; margin: 0px; padding: 0px; list-style: none; cursor: pointer;"></p><p align="center" style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;"><img id="31406750" title="点击图片浏览更多精彩内容" border="0" align="center" src="http://i3.cqnews.net/life/attachement/jpg/site82/20151125/b8aeed9d94bd17bfae6d41.jpg" sourcename="本地文件" sourcedescription="编辑提供的本地文件" alt="点击图片浏览更多精彩内容" style="border-style: none; margin: 0px; padding: 0px; list-style: none; cursor: pointer;"></p><p style="margin-top: 30px; margin-bottom: 30px; font-family: 宋体; font-size: 16px; list-style: none; width: 650px; overflow: hidden;">&nbsp;&nbsp;&nbsp;&nbsp;东水门长江大桥于2014年3月竣工，千厮门嘉陵江大桥于2014年6月竣工，协调一致的结构布置使两江四岸连成一个整体，而且是世界上首座“双子桥”。</p>','1','1','["http:\\/\\/pic.jiushang.cn\\/upload\\/web_app\\/11\\/2017\\/10\\/31\\/wMfMTWSJ5c.JPG"]'),
