Light&quot;;"><span style="font-size: 14px;">亮点：</span><span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal" align="left" style="margin: 0cm 6pt 0.0001pt; font-size: 12px; line-height: 19.2pt;"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;">01&nbsp;</span><span style="font-size: 9pt; font-family: &quot;Microsoft YaHei Light&quot;;"><span style="font-size: 14px;">耀世新品，全球发布：消费升级，轻脂饮品品类崛起，黑黑乳揭开大单品的神秘面纱，并推出无糖新品；</span><span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal" align="left" style="margin: 0cm 6pt 0.0001pt; font-size: 12px;"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;">02&nbsp;</span><span style="font-size: 9pt; font-family: &quot;Microsoft YaHei Light&quot;;"><span style="font-size: 14px;">财富计划，隆重发布：成为意向合伙人加入黑黑乳大商联盟，与经销商共享百亿财富计划；</span><span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal" align="left" style="margin: 0cm 6pt 0.0001pt; font-size: 12px;"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;">03&nbsp;</span><span style="font-size: 9pt; font-family: &quot;Microsoft YaHei Light&quot;;"><span style="font-size: 14px;">趋势解读，把握未来：探讨轻脂饮品未来发展之路，紧握健康饮品未来发展趋势；</span><span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal" align="left" style="margin: 0cm 6pt 0.0001pt; font-size: 12px; line-height: 19.2pt;"><span lang="EN-US" style="font-size: 9pt; font-family: &quot;Microsoft YaHei Light&quot;;"><br></span></p><p class="MsoNormal" style="margin: 0cm 6pt 0.0001pt; font-size: 12px; line-height: 21pt;"><span style="font-size: 9pt; font-family: &quot;Microsoft YaHei Light&quot;; letter-spacing: 0.75pt;"><span style="font-size: 14px;">随着消费升级的浪潮及健康意识的提升，</span><span lang="EN-US" style="font-size: 14px;">“</span><span style="font-size: 14px;">轻脂膳食</span><span lang="EN-US" style="font-size: 14px;">”</span><span style="font-size: 14px;">符合大健康趋势，已逐渐取代药物、手术等有损健康、风险度高的方式，成为广受国民青睐的保持身材和身体健康的首选。秋糖期间，首发轻脂饮品受众大数据分析，为轻脂饮品千亿市场蓝海的开创指明方向。黑黑乳是国内首款主打</span><span lang="EN-US" style="font-size: 14px;">“</span><span style="font-size: 14px;">轻脂</span><span lang="EN-US" style="font-size: 14px;">”</span><span style="font-size: 14px;">概念的饮品，为现代白领带来全新的饮食轻脂体验。黑黑乳创新品类借力</span><span lang="EN-US" style="font-size: 14px;">IP</span><span style="font-size: 14px;">营销，吹响轻脂饮品集结号。</span></span><span lang="EN-US" style="font-size: 9pt; font-family: &quot;Microsoft YaHei Light&quot;;"><o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 6pt 0.0001pt; font-size: 12px; line-height: 21pt;"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;">&nbsp;</span></p><p class="MsoNormal" align="left" style="font-size: 12px;"><span style="font-size: 9pt; font-family: &quot;Microsoft YaHei Light&quot;;"><span style="font-size: 18px;"><span style="font-weight: 700;">同一地点，引爆秋糖</span></span><span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal" style="margin: 0cm 6pt 0.0001pt; font-size: 12px; line-height: 21pt;"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;; letter-spacing: 0.75pt;"><br></span></p><p class="MsoNormal" style="margin: 0cm 6pt 0.0001pt; font-size: 12px; line-height: 21pt;"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;; letter-spacing: 0.75pt;">2017</span><span style="font-size: 9pt; font-family: &quot;Microsoft YaHei Light&quot;; letter-spacing: 0.75pt;"><span style="font-size: 14px;">全国春季糖酒会糖烟酒周刊食品类活动精彩纷呈，不容错过。为方便经销商参会，组委会选择在</span><span lang="EN-US" style="font-size: 14px;">10</span><span style="font-size: 14px;">月</span><span lang="EN-US" style="font-size: 14px;">6</span><span style="font-size: 14px;">、</span><span lang="EN-US" style="font-size: 14px;">7</span><span style="font-size: 14px;">、</span><span lang="EN-US" style="font-size: 14px;">8</span><span style="font-size: 14px;">、</span><span lang="EN-US" style="font-size: 14px;">9</span><span style="font-size: 14px;">日，持续四天的时间，集中在重庆丽笙世嘉酒店集中发布。</span></span><br></p><p class="MsoNormal" align="left" style="margin-right: 6pt; font-size: 12px;"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;">&nbsp;</span></p><p class="MsoNormal" style="margin: 0cm 6pt 0.0001pt; font-size: 12px; line-height: 21pt;"><span style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;; letter-spacing: 0.75pt;">重庆丽笙世嘉酒店是重庆秋糖期间，食品企业和经销商重点关注的酒店之一。是中国高端休闲食品、饮品、调味品品牌集聚区，专注优质品牌服务，让经销商选品不再头疼。同时，酒店交通极为便利，作为重庆少有的五星酒店，成为秋糖产品发布、大容量、高人气的专业食品发布区，更能充分调动参会企业及经销商的体验感。</span><span lang="EN-US" style="font-size: 9pt; font-family: &quot;Microsoft YaHei Light&quot;;"><o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 6pt 0.0001pt; font-size: 12px; line-height: 21pt;"><span lang="EN-US" style="font-size: 14px; font-family: &quot;Microsoft YaHei Light&quot;;">&nbsp;</span></p>','1','1','["http:\\/\\/pic.jiushang.cn\\/upload\\/web_app\\/11\\/2017\\/10\\/31\\/xeN4eHQc7F.JPG"]'),
('92','重庆不可错过的江景 打探6条滨江路有啥耍事','2','6','轮播图','hello','2017-10-31 10:03:41','<p style="font-size: 14px; line-height: 21px;"><font face="微软雅黑">重庆这个我爱的地方，在我心中永远都是一个美丽的丰碑。有人说爱上一座城，是因为那个城里住着一个爱的人。爱上一座城，是因为那个城里有很多诱人的美食美景。重庆，魂牵梦萦的地方。不信？就跟着小编去看看的滨江路！</font></p><p style="font-size: 14px; line-height: 21px;"><font face="微软雅黑">　　美色美景重庆滨江路</font></p><p style="font-size: 14px; line-height: 21px;"><font face="微软雅黑">　　除了山城，重庆的江景也是美不胜收。几条滨江路上霓虹闪烁，江水倒映着城市的繁华，起伏的地势和波光粼粼的水光让重庆的魅力闪耀。</font></p><p style="font-size: 14px; line-height: 21px;"><font face="微软雅黑">　　1、长滨路</font></p><p align="center" style="font-size: 14px; line-height: 21px;"><br></p><p style="font-size: 14px; line-height: 21px;"><font face="微软雅黑">　　这条路上有两个公园：珊瑚公园、滨江公园。但最让人心动的，还是另外两个巴渝文化的瑰宝：珊瑚坝、湖广会馆。湖广会馆，是目前已知全国城市中心区最大的古会馆建筑群，又名禹王庙，是古代重庆作为繁华商埠的历史见证。整个古建筑群雕梁画栋、涂朱鎏金，有浮雕镂雕的取材于西游记、西厢记、封神榜、二十四孝等人物故事图案，还有龙凤等各种动物图案及各种奇花异草等植物图案，雕镂精湛，栩栩如生。</font></p><p style="font-size: 14px; line-height: 21px;"><font face="微软雅黑">　　2、嘉滨路</font></p><p align="center" style="font-size: 14px; line-height: 21px;"><br></p><p style="font-size: 14px; line-height: 21px;"><font face="微软雅黑">　　这是重庆最早建成的滨江路，但轻轨一路上都在它的上空飞驰，使它洋溢着莫大的青春灵气。从大溪沟至千厮门沿线，江边停泊着无数的游轮渔庄，是市民消夏餐叙的良好去处，而洪崖洞民俗文化区坐落在其间，更使它添了几分古朴的巴蜀情怀与现代的商业气质。</font></p><p style="font-size: 14px; line-height: 21px;"><font face="微软雅黑">　　3、北滨路</font></p><p align="center" style="font-size: 14px; line-height: 21px;"><br></p><p style="font-size: 14px; line-height: 21px;"><font face="微软雅黑">　　嘉陵江的北岸，晨曦晚霞之中，触目皆风景，呼吸皆江山之精气，是重庆人极为喜爱的都市休闲会客厅。北滨路以“春夏秋冬——四季之路”为主题全新打造，春之路将是艺术品拍卖会、企业交流酒会、国际友好城市节等活动举办地；夏之路将建设工业博物馆，辅以手工作坊、陶艺吧等，开发低密度写字楼，并将举办辣文化美食节、露天摇滚演唱会、高端汽车展、街头文化巡演、水上焰火晚会等；秋之路将体现亲水主题，发展主题餐饮、文化剧场等业态，举办创意艺术作品展、怀旧音乐会、印象摄影展、茶文化品鉴会等活动；冬之路充满提升、感悟，将开展巴渝民俗文化汇演等活动。</font></p><p style="font-size: 14px; line-height: 21px;"><font face="微软雅黑">　　4、南滨路</font></p><p align="center" style="font-size: 14px; line-height: 21px;"><br></p><p style="font-size: 14px; line-height: 21px;"><font face="微软雅黑">　　它见证了重庆从这里走向世界，这里有立德乐洋行老建筑、有法国水师兵营，有美国水师俱乐部；还有黄葛晚渡、海棠烟雨、龙门浩月、字水宵灯、峡江开埠和禹王遗踪六大景区；更有兴澳海底世界、洋人街、海棠晓月温泉区。这里背倚南山，面朝渝中，拥有绵延数公里的美食街区，每年更有数以万计食客同吃火锅的壮观场面，南滨路是“中国最大的滨江公园”和“中华美食街”。</font></p><p style="font-size: 14px; line-height: 21px;"><font face="微软雅黑">　　5、沙滨路</font></p><p align="center" style="font-size: 14px; line-height: 21px;"><br></p><p style="font-size: 14px; line-height: 21px;"><font face="微软雅黑">　　沙坪坝是重庆的历史文化区，众多知名的高等学府在此落脚。嘉陵江畔，歌乐山下更是孕育了“爱国 奋斗 团结 奉献”的红岩精神。沙滨路不长，但绿化与文化的风格显著。这条路的尽头是著名的明清古镇磁器口。昔日更有“三多”：庙宇多、名人足迹多、茶馆多；这里是重庆码头文化的核心代表。</font></p><p style="font-size: 14px; line-height: 21px;"><font face="微软雅黑">　　6、九滨路</font></p><p align="center" style="font-size: 14px; line-height: 21px;"><br></p><p style="font-size: 14px; line-height: 21px;"><font face="微软雅黑">　　九滨路是西城新兴的重要交通要道，串联着九龙港码头、重庆新港、菜园坝段的水果批发市场以及皮革市场、朝天门码头等重庆重要的物流港口。其独有的港口文化，将集聚庞大的人流、物流、商流，具备极大的商业发展潜力，这也是南、北滨路所无法比拟。</font></p>','1','1','["http:\\/\\/pic.jiushang.cn\\/upload\\/web_app\\/11\\/2017\\/10\\/31\\/jjxrrdx27W.JPG"]'),
