('94','测试显示不出来的数据','2','2','单图','hello','2017-11-01 10:20:47','<p class="MsoNormal" style="font-size: 12px; text-align: center; text-indent: 31.5pt;"><span style="font-family: 微软雅黑; font-size: 14px; font-weight: bold; text-indent: 0px;">&nbsp; &nbsp; &nbsp;黔酱滋圣酒业位于酿酒历史悠久的赤水河流域的贵州茅台。我们不仅有得天独厚的自然资源，还有独具特色传承百年的少数民族酿酒技艺。目前，主要经营产品为：酱香型白酒，生产采用固体发酵工艺，并运用先进的现代检测手段，对产品全过程实施严格的质量控制，确保产品质量优于国家标准，为消费者带来最具口感和健康的美酒！</span></p><p class="MsoNormal" style="font-size: 12px; text-align: center; text-indent: 31.5pt;"><span style="font-family: 微软雅黑; font-size: 14px; font-weight: bold; text-indent: 0px;"><br></span></p><p style="font-size: 12px; text-align: center;"><span style="font-weight: 700;"><font face="微软雅黑"><span style="font-size: 14px; background-color: rgb(255, 239, 198);">滋圣系列</span><span lang="EN-US"><span style="font-size: 14px; background-color: rgb(255, 239, 198);">:</span></span></font></span></p><p class="MsoNormal" style="font-size: 12px; text-align: center;"><span style="font-weight: 700;"><font face="微软雅黑"><span style="font-size: 14px; background-color: rgb(255, 239, 198);"><br></span><o:p></o:p></font></span></p><p class="MsoNormal" style="font-size: 12px; text-align: center;"><font face="微软雅黑"><span style="font-size: 14px;">汇赤河红土之灵，汲云鼓高粱之神，采益镇小麦之精，集鳛部风华之韵</span><span lang="EN-US"><o:p></o:p></span></font></p><p class="MsoNormal" style="font-size: 12px; text-align: center;"><font face="微软雅黑"><span style="font-size: 14px;">利用上千年传统酿造工艺：端午制曲，重阳下沙，九次蒸煮，八次摊凉、发酵，七次取酒；入库窖藏数年后，再经“酱人”精心勾调而成。</span></font></p><p class="MsoNormal" style="font-size: 12px; text-align: center; text-indent: 31.5pt;"><font face="微软雅黑" color="#0000ff"><span style="font-size: 14px;"><br></span><span lang="EN-US"><o:p></o:p></span></font></p>','1','1','["http:\\/\\/pic.jiushang.cn\\/upload\\/web_app\\/11\\/2017\\/11\\/01\\/F45GYRDQRh.png"]');
