  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态：1为常态',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS  `pre_min_user_v2`;
CREATE TABLE `pre_min_user_v2` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `js_uid` int(11) NOT NULL COMMENT '酒商系统用户ID',
  `nick_name` char(30) NOT NULL DEFAULT '' COMMENT '微信昵称',
  `header` varchar(255) NOT NULL DEFAULT '' COMMENT '微信头像',
  `name` varchar(50) DEFAULT '' COMMENT '真实姓名',
  `tel` char(11) NOT NULL DEFAULT '0' COMMENT '电话号码',
  `openid` char(32) DEFAULT NULL COMMENT '微信用户的唯一id',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态：1为常态',
  `identity` tinyint(1) NOT NULL DEFAULT '1' COMMENT '身份：1为参展、2为办展',
  `tags` tinytext NOT NULL COMMENT '标签',
  `customer_number` varchar(64) DEFAULT NULL COMMENT '客户邀请码',
  `qrcode` varchar(64) DEFAULT NULL COMMENT '二维码邀请',
  `validated` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '办展方是否经过验证',
  `company_info` text COMMENT '公司信息',
  `card_num` varchar(32) DEFAULT NULL COMMENT '身份证号',
  `person_card_image_url` varchar(255) DEFAULT NULL COMMENT '身份证手持图片',
  `company_licence_url` varchar(255) DEFAULT NULL COMMENT '营业执照图片',
  PRIMARY KEY (`id`),
  UNIQUE KEY `OPENID` (`openid`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1002 DEFAULT CHARSET=utf8;

